INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`)
VALUES
	(1,'<p class=\"para--m para\">Many charities’ goals are similar, as is the functionality we require, but little shared working takes place.</p>\r\n<p class=\"para--s para\">By working together, driving shared areas of interest and influencing open source developments we can bring efficiencies, improve the digital experience for our users, and have great impact.</p>\r\n<p class=\"para--m para\">Together we can make a biggetr diference.</p>\r\n\r\n','Sharing Ideas for charities','full_html'),
	(2,'This site was built as a collaboration between <a href=\"#\" title=\"manisfesto\">Manifesto Digital</a> and <a href=\"#\" title=\"compucorp\">Compucorp</a>','Foote Colab Block','full_html');
